let ts = localStorage
let time;

if(ts.getItem("time") !=null){
    time = parseInt(ts.getItem("time"))
}else{
    time = 300;
    ts.setItem("time", time)
}

let score = 0;

function rnd(n){
    return Math.floor(Math.random() * n);
}

$("#score").knob({
    min: 0,
    max: 10,
    angleArc: 120,
    angleOffset: -60,
    displayInput: false,
    lineCap: "round",
    readOnly: true,
    bgColor: "lightgray",
    fgColor: "lightgreen",
})

$("#timer").knob({
    min: 0,
    max: 300,
    readOnly: true,
    bgColor: "lightgray",
    fgColor: "lightgreen",
})

function startTimer(){
    setInterval(()=>{
        time = parseInt(ts.getItem("time")) - 1;
        $("#timer").val(time).trigger("change");
        if(time <= 0){
            alertify.error("Time is out!")
            setTimeout(()=> window.open("index.html", "_self", false), 1000)
            ts.removeItem("time")
        }else  if (time > 0){
            ts.setItem("time", time)
        }
    }, 1000)
}

$("#start").on("click", ()=>{
    $("#start").css("display", "none")
    startTimer();
})
